ot;^15logseq____&quot;,[3607,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;時間創造者指的是從星辰之⽗開始⾛向彰顯所流經的神聖之⼒。祂⽤那源⾃於照耀及彰顯⽣命的純淨光華之中，那神的⽕花來著⼿形成⽣命的形態：「曾在⿊暗中閃耀的光，無法被⿊暗所包容。」那光是開始塑造形狀和模式的神聖意識，是⾛向⽣命、織造我們宇宙的第⼀步，這⼀步便是時間的創造。　　時間創造者表現出時間軸正形成為某個新的東西：時間的創造被宇宙織者織進顯化的模式裡，且最終會交付到命運三女神⼿上。這張牌告訴我們某件事正逐漸成形，但仍有各種可能的⽅式去完成它。祂是形成時間和物質的模式。它是⼀張強⽽有⼒的牌，它的出現告訴我們在深處有著強⼤的創造⼒正在運作，⼀個為了占⼘主題的「新的時間」正在形成。這新的時間預⽰著⼀段命運新周期的⽣成，這命運最終將會在某個⼈的⽣活中表現出來。這張牌也可以就字⾯上解讀為對某件事物「增加時間」。　　⼀般占⼘：籌劃，為新的開端劃定界限、形成⼀條命運線、⾃我形成的⼀條新的命運路徑、新⼀輪事件的開始、被賦予更多的時間、⼀段新的時間⽤來完成某件事。logseq____&quot;,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^Flogseq____&quot;,3537,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^Xlogseq____&quot;,1210,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^Vlogseq____&quot;,3537,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^Ulogseq____&quot;,1210,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^1Blogseq____&quot;,true,536870918]],[logseq____&quot;^15logseq____&quot;,[3607,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u645138b6-190c-402f-bba7-3ccccfaba142logseq____&quot;,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Tropicallogseq____&quot;,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Flogseq____&quot;,3659,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Xlogseq____&quot;,32,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Vlogseq____&quot;,3659,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^Ulogseq____&quot;,32,536870918]],[logseq____&quot;^15logseq____&quot;,[3650,logseq____&quot;^1Blogseq       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
